import Header from './components/Header';

const HeaderWrapper = styled.div`
  height: 100px;
  background:  ${props => props.theme};
  box-shadow: 0px 2px 5px 1px rgb(0 0 0 / 20%);
  display: flex;
  align-items: center;
  padding: 0 50px;
`;


HeaderWrapper.defaultProps= {
    theme: "white"
}

const AppLayout = () => {
    return (
        <>
            <HeaderWrapper>
                <Header logo={''}/>
            </HeaderWrapper>
            <div>
                Content
            </div>
        </>
    )
}
export default AppLayout;
